import React from 'react';
import './App.css';
import {BrowserRouter, Route} from 'react-router-dom';
// Pages
import Home from './views/Home';
import Profile from './views/Profile';
// Components
import Footer from './components/Footer';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
      <Home />
      <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
